Ol Katolik, o Ketlik, o Popi ol i manmeri bilong wanpela lain bilong &lt;a href="Kristen"&gt;Kristen&lt;/a&gt;. Ol Kristen ol i manmeri ol i save lotuim &lt;a href="Jisas"&gt;Jisas&lt;/a&gt;, o Krais, na ol i tingting Jisas em i &lt;a href="Got"&gt;Got&lt;/a&gt; o Bikpela i kam long Graun. 
Insait long &lt;a href="Kristen"&gt;Kristen&lt;/a&gt;, i gat kainkain lain. Ol Katolik i lain i gat wanpela bikpela bos ol i kolim &lt;a href="Pop"&gt;Pop&lt;/a&gt;. Ol i bilip olsem dispela Pop sanap long ples bilong Pita, huset bin stap olsem namba wan disaipel bilong Jisas taim i bin stap long graun. Long olgeta ples long graun, bishop bilong Katolik Sios bai stap olsem bosman bilong Sios long dispela ples, na tu, olgeta bishop bilong Katolik Sios bilong kain kain hap ol bilip olsem ol mas holim pas long Pop olsem olgeta disaipels bin holim pas long Pita long taim Jisas bin go bek long Papa Got bilong em yet long heven. Pop i save stap long citi bilong &lt;a href="Rom"&gt;Rom&lt;/a&gt; long kantri nem bilong em &lt;a href="Itali"&gt;Itali&lt;/a&gt;. Nem bilong man huset i Pop nau nem bilong em Pop &lt;a href="Francis"&gt;Francis&lt;/a&gt;. 
Tu ol Katolik save bilip olsem ol holim pas long wankain bilip olgeta Kristen long olgeta taim bin holim. Long wanpela we bilong autim dispela bilip em olsem:
Mi bilip long God Papa, em i gat olgeta strong, &lt;br&gt;
em i as bilong heven na graun olgeta, &lt;br&gt;
em yet i putim &lt;br&gt;
Mi bilip long Jisas Krais, em wanpela tasol em i Pikinini tru bilong God. &lt;br&gt;
Em i Bikpela bilong yumi Holi Spirit &lt;br&gt;
i putim em long bel bilong yangpela meri Maria, &lt;br&gt;
na em i karim em Pontias Pailat &lt;br&gt;
i tok na i givim pen long em, &lt;br&gt;
na ol i nilim em long diwai Kros. &lt;br&gt;
Em i dai pinis na ol i planim em, &lt;br&gt;
na em i go daun long ples bilong ol daiman &lt;br&gt;
Em i kirap bek long matmat long de namba tri &lt;br&gt;
Na bihain em i goap long heven. &lt;br&gt;
Nau em i sindaun long han sut bilong God Papa i gat olgeta strong &lt;br&gt;
Bihain Em bai i kam bek bilong mekim kot long ol man i gat laip na long ol daiman &lt;br&gt;
Mi bilip long Holi Spirit &lt;br&gt;
Mi bilip long Holi Kristen Sios. &lt;br&gt;
Mi bilip long olgeta Kristen i wanbel tru &lt;br&gt;
Mi bilip long God i save tekewe olgeta sin bilong yumi &lt;br&gt;
Mi bilip long olgeta daiman bai i kirap long matmat &lt;br&gt;
Mi bilip long God i save givim yumi laip i stap oltaim oltaim. Tru. &lt;br&gt;
